    getCompanySettingsData() {
        this.compamnyService.getCompanySettings().subscribe((res) => {
            if (res["status"] &&
                typeof res["status"] == "string" &&
                (res["status"] == "400" || res["status"] == "500")) {
                if (res["error"]) {
                    this.coreService.showWarningToast(res["error"]);
                }
                else {
                    this.coreService.showWarningToast("Something went wrong, Please try again later");
                }
            }
            else {
                if (res["status"] == "200") {
                    this.coreService.removeLoadingScreen();
                    console.log("data", res["data"]);
                    this.companyFormN = res["data"];
                    this.mode = "edit";
                    this.companyLogoName =
                        res["data"]["companySettings"]["companyLogoName"];
                    if (res["data"]["companySettings"]["country"]) {
                        const countryCode = res["data"]["companySettings"]["country"];
                        this.selectedcountry = this.countryOptions.filter((option) => {
                            return countryCode.split(",").includes(option.code);
                        });
                    }
                    if (res["data"]["companySettings"]["baseCurrency"]) {
                        const countryCode = res["data"]["companySettings"]["baseCurrency"];
                        this.selectedBaseCurrencies = this.baseCurrencyOptions.filter((option) => {
                            return countryCode.split(",").includes(option.code);
                        });
                        this.updatePrimaryBaseCurrencyOptions(this.selectedBaseCurrencies);
                    }
                    if (res["data"]["companySettings"]["crossCurrency"]) {
                        const countryCode = res["data"]["companySettings"]["crossCurrency"];
                        this.selectCrossCurrency = this.crossCurrencyOptions.filter((option) => {
                            return countryCode.split(",").includes(option.code);
                        });
                    }
                    if (res["data"]["companySettings"]["primaryBaseCurrency"]) {
                        const baseCurrencyCode = res["data"]["companySettings"]["primaryBaseCurrency"];
                        this.selectedPrimaryBaseCurrency = this.mapCodeToItem(baseCurrencyCode, this.baseCurrencyOptions);
                    }
                    if (res["data"]["companySettings"]["timeZone"]) {
                        const timeZoneCode = res["data"]["companySettings"]["timeZone"];
                        this.selectedTimeZone = this.mapCodeToItem(timeZoneCode, this.timeZoneOptions);
                    }
                    if (res["data"]["companySettings"]["numberFormat"]) {
                        const numberFormatCode = res["data"]["companySettings"]["numberFormat"];
                        this.selectNumberFormat = this.mapCodeToItem(numberFormatCode, this.numberFormatOptions);
                    }
                    if (res["data"]["companySettings"]["dateFormat"]) {
                        const numberFormatCode = res["data"]["companySettings"]["dateFormat"];
                        this.selectDateFormat = this.mapCodeToItem(numberFormatCode, this.dateFormatOptions);
                    }
                    if (res["data"]["companySettings"]["primaryLanguage"]) {
                        const numberFormatCode = res["data"]["companySettings"]["primaryLanguage"];
                        this.selectPrimaryLanguage = this.mapCodeToItem(numberFormatCode, this.primaryLanguageOptions);
                    }
                    if (res["data"]["companySettings"]["themes"]) {
                        const themesCode = res["data"]["companySettings"]["themes"];
                        this.selectThemes = this.mapCodeToItem(String(themesCode), this.themeOptions);
                        console.log("theme", this.selectThemes);
                        console.log("theme", themesCode);
                        console.log("theme", this.themeOptions);
                    }
                    if (res["data"]["accountsSettings"]["accounting"]) {
                        const numberFormatCode = res["data"]["accountsSettings"]["accounting"];
                        this.selectAccounting = this.mapCodeToItem(numberFormatCode, this.accountingOptions);
                    }
                    if (res["data"]["remittanceSettings"]["requiredDualCounter"] === "Y") {
                        const requiredDualCounterCode = "1";
                        this.selectRequiredDualCounter = this.mapCodeToItem(requiredDualCounterCode, this.requiredDualCounterOptions);
                    }
                    else {
                        const requiredDualCounterCode = "2";
                        this.selectRequiredDualCounter = this.mapCodeToItem(requiredDualCounterCode, this.requiredDualCounterOptions);
                    }
                    if (res["data"]["loginSettings"]["captchaRequired"] === "Y") {
                        const requiredDualCounterCode = "1";
                        this.selectCaptchaRequired = this.mapCodeToItem(requiredDualCounterCode, this.captchaRequiredOptions);
                    }
                    else {
                        const requiredDualCounterCode = "2";
                        this.selectCaptchaRequired = this.mapCodeToItem(requiredDualCounterCode, this.captchaRequiredOptions);
                    }
                    if (res["data"]["loginSettings"]["passwordPolicy"] === "Y") {
                        const requiredDualCounterCode = "1";
                        this.selectPasswordPolicy = this.mapCodeToItem(requiredDualCounterCode, this.setPasswordPolicyOptions);
                    }
                    else {
                        const requiredDualCounterCode = "2";
                        this.selectPasswordPolicy = this.mapCodeToItem(requiredDualCounterCode, this.setPasswordPolicyOptions);
                    }
                }
            }
        }, (err) => {
            this.coreService.removeLoadingScreen();
            console.log("error in getting", err);
            this.coreService.showWarningToast("Something went wrong, Please try again later");
        });
    }
