        // inputElement.select();
        // document.execCommand("copy");
        // inputElement.setSelectionRange(0, 0);
        let selBox = document.createElement("textarea");
        selBox.style.position = "fixed";
        selBox.style.left = "0";
        selBox.style.top = "0";
