    filterMenuItems(e) {
        this.menuItems = this.$MenuItems;
        let arr = [];
        this.$MenuItems.forEach((item) => {
            let found = false;
            if (item.label.toLowerCase().includes(e.target["value"]?.toLowerCase())) {
                found = true;
            }
            else if (item.items) {
                item.items.forEach((subItem) => {
                    if (!found) {
                        if (subItem["label"]
                            .toLowerCase()
                            .includes(e.target["value"]?.toLowerCase())) {
                            found = true;
                        }
                    }
                });
            }
            if (found) {
                arr.push(item);
            }
        });
        this.menuItems = arr;
    }
